function draw() {
    const center_h = 300;
    const center_w = 300;
    var canvas = document.getElementById('gameboard');
    if (canvas.getContext) {
        var ctx = canvas.getContext('2d');
        var circle = new Path2D();
        circle.arc(center_h, center_w, 300, 0, 2 * Math.PI);
        ctx.fillStyle='white';
        ctx.fill(circle);
        ctx.stroke(circle);
    }
}
export default draw;
